import React from "react";
import ExpenseData from "./ExpenseData";

const ExpenseItem = () => {
  return (
    <div className="expense-item">
      <ExpenseData />
      <div className="expense-item__description">
        <h2>Title</h2>
      </div>
    </div>
  );
};

export default ExpenseItem;
